"use client"
import { useState, useEffect } from "react"
import { Link, useNavigate } from "react-router-dom"
import { useAuth } from "../../contexts/AuthContext"
import { useAuth0 } from "@auth0/auth0-react"
import "./AuthPages.css"

const LoginPage = () => {
  const [usernameOrEmail, setUsernameOrEmail] = useState("")
  const [password, setPassword] = useState("")
  const [error, setError] = useState("")
  const [loading, setLoading] = useState(false)
  const { login, isAuthenticated } = useAuth()
  const { loginWithRedirect, isAuthenticated: isAuth0Authenticated, user: auth0User } = useAuth0()
  const navigate = useNavigate()

  // Handle Auth0 authentication
  useEffect(() => {
    const handleAuth0Login = async () => {
      if (isAuth0Authenticated && auth0User) {
        try {
          // Call your backend to handle Auth0 login
          const response = await fetch("/api/auth/auth0-callback", {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify({
              auth0Id: auth0User.sub,
              email: auth0User.email,
              name: auth0User.name,
            }),
          })

          if (response.ok) {
            const data = await response.json()
            // Update your auth context with the token and user info
            if (data.data && data.data.token) {
              localStorage.setItem("token", data.data.token)
              window.location.href = "/" // Redirect to home page
            }
          }
        } catch (error) {
          console.error("Error handling Auth0 login:", error)
          setError("Failed to process Auth0 login")
        }
      }
    }

    if (isAuth0Authenticated && auth0User) {
      handleAuth0Login()
    }
  }, [isAuth0Authenticated, auth0User])

  // Redirect if already authenticated
  useEffect(() => {
    if (isAuthenticated) {
      navigate("/")
    }
  }, [isAuthenticated, navigate])

  const handleSubmit = async (e) => {
    e.preventDefault()
    setError("")

    if (!usernameOrEmail.trim() || !password) {
      setError("Please fill in all fields")
      return
    }

    try {
      setLoading(true)
      const result = await login({ usernameOrEmail, password })

      if (result.success) {
        navigate("/")
      } else {
        setError(result.error || "Failed to login. Please check your credentials.")
      }
    } catch (err) {
      setError("An unexpected error occurred. Please try again.")
      console.error("Login error:", err)
    } finally {
      setLoading(false)
    }
  }

  const handleGoogleLogin = () => {
    loginWithRedirect({
      authorizationParams: {
        connection: "google-oauth2",
      },
    })
  }

  return (
    <div className="auth-container">
      <div className="auth-card">
        <div className="auth-header">
          <h2>Welcome Back</h2>
          <p>Sign in to your SkillUp account</p>
        </div>

        {error && <div className="auth-error">{error}</div>}

        <form onSubmit={handleSubmit} className="auth-form">
          <div className="form-control">
            <label htmlFor="usernameOrEmail">Username or Email</label>
            <input
              type="text"
              id="usernameOrEmail"
              value={usernameOrEmail}
              onChange={(e) => setUsernameOrEmail(e.target.value)}
              placeholder="Enter your username or email"
              disabled={loading}
            />
          </div>

          <div className="form-control">
            <label htmlFor="password">Password</label>
            <input
              type="password"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Enter your password"
              disabled={loading}
            />
          </div>

          <button type="submit" className="btn btn-primary w-full" disabled={loading}>
            {loading ? "Signing in..." : "Sign In"}
          </button>

          <button
            type="button"
            className="btn btn-google w-full"
            style={{ marginTop: "10px" }}
            onClick={handleGoogleLogin}
            disabled={loading}
          >
            <img src="/google.png" alt="Google" style={{ width: "20px", marginRight: "8px" }} />
            Sign in with Google
          </button>
        </form>

        <div className="auth-footer">
          <p>
            Don't have an account? <Link to="/register">Sign Up</Link>
          </p>
        </div>
      </div>
    </div>
  )
}

export default LoginPage
